// react
import React, { Component } from 'react';

// third-party
import { NavLink } from 'react-router-dom';
import { IconAlertSvg, IconInformationSvg, IconLegendSvg } from '../../content/images/svg';

// pages
import { Modal } from './../shared/Modal';

export class NavIcons extends Component {
    constructor() {
        super();

        this.state = {
            visible: false,
            handleClose: handleClose
        }
    }

    showModal = () => {
        this.setState({
            visible: true
        });
    };

    hideModal = () => {
        this.setState({
            visible: false
        });
    };

    render() {
        return (
            <div className="nav-icons">
                <div>
                    <button type="button" onClick={this.showModal}>
                        <span>
                            <IconInformationSvg />
                        </span>
                    </button>
                    <NavLink exact activeClassName="selected" to="/">
                        <span>
                            <IconInformationSvg />
                        </span>
                    </NavLink>
                </div>
                <div>
                    <NavLink exact activeClassName="selected" to="/">
                        <span>
                            <IconAlertSvg />
                        </span>
                    </NavLink>
                </div>
                <div>
                    <NavLink exact activeClassName="selected" to="/">
                        <span>
                            <IconLegendSvg className="nav-icons__button-icon" />
                        </span>
                    </NavLink>
                </div>

                <Modal visible={this.state.show} handleClose={this.hideModal}>
                    <p>test</p>
                </Modal>

            </div>
        );
    }
}
